    18,nt"tags": [],nt"title": "Temperature, salinity and other variables collected
    from discrete sample and profile observations using CTD, bottle and other instruments
    from the JAN MAYEN in the Norwegian Sea from 1993-04-01 to 1995-11-01 (NODC Accession
    0115677)",nt"tracking_summary": {ntt"total": 3,ntt"recent": 3nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-27T00:32:26.170471",nt"name":
    "temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation28f2d",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115677 includes chemical,
    discrete sample, physical and profile data collected from JAN MAYEN in the Norwegian
    Sea from 1993-04-01 to 1995-11-01 and retrieved during cruise CARINA/OMEX1NS (OMEX-1).
    These data include HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential
    temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by K. Tande
    of University of Bergen as part of the CARINA/OMEX1NS (OMEX-1) data set.nnThe CARINA
    (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
    collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
    a merged internally consistent data set of open ocean subsurface measurements for
    biogeochemical investigations, in particular, studies involving the carbon system.
    The original focus area was the North Atlantic Ocean, but over time the geographic
    extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
    Ocean, and the Southern Ocean.",nt"license_title": null,nt"extras": [{ntt"key":
